import React from "react";
import Navigation from "./components/Navigation";
import "./styles/style.css";
import { BrowserRouter, Routes, Route } from "react-router-dom";

const App = () => {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Navigation />}></Route>
      </Routes>
    </BrowserRouter>
  );
};

export default App;
